// apiConfig.js

const apiBaseURL = process.env.REACT_APP_API_BASE_URL || 'https://localhost:7157/api';

const apiEndpoints = {
  login: `${apiBaseURL}/Auth/login`,
  register: `${apiBaseURL}/Auth/register`,
  userData: `${apiBaseURL}/user/data`,
  adminData: `${apiBaseURL}/admin/data`,
};

export default apiEndpoints;
